function TodoItem({ todoName, todoDate }) {
    return (
      <div className="container">
        <div className="row kg-row">
          <div className="col-6">{todoName}</div>
          <div className="col-4">{todoDate}</div>
              
          
        </div>
      </div>
    );
  }
  
  export default TodoItem;
